import React, { Component } from 'react';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Table from 'react-bootstrap/Table';
import Media from 'react-bootstrap/Media';

class GamePreviewContainer extends Component {
	render() {
		return (
			<div>
				<Row className="justify-content-md-center">
					<h1>My Game Collection</h1>
				</Row>
				<Row className="justify-content-md-center" style={{borderBottom: "1px solid black", padding:"20px"}}>
					<p >One of my favorite things to do is make games. In this section of my site I will host a collection of games I have made.</p>
				</Row>
				<Row className="justify-content-md-center" style={{borderBottom: "1px solid black", padding:"20px"}}>
						<Media>	
							<img 
								width={64}
								height={64}
								className="mr-3"
								src="../../imgs/fish_preview.jpg"
								alt="fish game picture"
							/>
							<Media.Body>
								<h5>Stay off the Line!</h5>
								<p>
									Game where you play as a tasty fish trying to survive in the ocean. Try to last as long as you can, and Stay Off the Line!
								</p>
							</Media.Body>
						</Media>
				</Row>
			</div>
		);
	}
}

export default GamePreviewContainer;
